1074	550	en	 Innovative automated greenhouse complex "LipetskAgro" 	The grand opening of the first phase of an innovative automated greenhouse complex "LipetskAgro" was held in the Lipetsk Region. On the area of 4.3 hectares will be grown more than two thousand tons of vegetables a year.\r\nUnique, one of the country - such characteristics of the project gave guests, among whom was the head of the Lipetsk region, Oleg Korolev, investors, heads of regions, companies, leading experts in the field of vegetable growing.\r\n"Today we are opening the first project in Russia with greenhouses fifth generation, where high yields are obtained with minimum power consumption," - said Chairman of the Board of Directors of "TC" LipetskAgro "Dmitry Lachine.\r\nThe first phase of the complex was built and equipped in record time - four months. There has modern domestic technological equipment and control systems. Created about 60 jobs in the future, when reaching full capacity, the number of vacancies will increase to five hundred. It is expected that this will happen by 2016.\r\nIn the introduction of the second stage area will expand to 9.4 hectares with an annual yield of 6.5 thousand. Tons. In total, the investors are planning to invest in a set of 3.5 billion rubles, of which 850 million has already been spent.\r\nDmitriy Lapshin said that the project was made possible in close cooperation with the regional authorities, which have provided a platform engineering infrastructure and support for the company in the form of tax breaks on property in the amount of 53.6 million rubles, and JSC "Sberbank".\r\nIn turn, the head of the Lipetsk region, Oleg Korolev thanked investors for what they "believe in Dankovskiy area."\r\n"After the collapse of the Soviet agriculture was destroyed. But now we see that both the village and agriculture revived. The advent of modern technology, which is achieved by a unique capacity. Here per square meter will collect 75 kilograms of vegetables! Such projects will provide a high rate of agricultural development of the Lipetsk region, decent work and high level of quality of life. However, the emergence of such projects suggests a favorable investment climate created in the region, "- said Oleg Korolev.\r\nAt the end of the ceremony the head of the region, along with the company's management and guests toured the greenhouses. December 25 last year, experts have planted seedlings of lettuce in an area of 0.4 hectares, the crop is harvested in a month. In April there will be the first tomatoes.\r\n"Greenhouse complex world level. This is a huge technological breakthrough in vegetable-covered ground "- what they see such an assessment given by the president of the association" Greenhouses of Russia "Arkady Ants, who took part in the opening.	Dankovskiy district, Lipetsk region				  						Dankovskiy district, Lipetsk region	2015-02-06 06:04:09.543012	2015-02-06 06:04:09.543012
